import React from 'react';
import './exerciseComponent.scss';
import { TextField } from '@material-ui/core';

class ExerciseComponent extends React.Component {
    
    render() {
        console.log(this.prospexercise);
        return (
            <div className="exerciseComponent">
                <div className="exerciseComponent__item-row exerciseComponent__item-row--margin">
                    <TextField
                        className="exerciseComponent__item-row-single"
                        id="filled-basic"
                        label="Exercise"
                        variant="filled"
                        defaultValue={this.props.exerciseName}
                    />
                    <TextField
                        className="exerciseComponent__item-row-single"
                        id="filled-basic"
                        label="Muscle"
                        variant="filled"
                        defaultValue={this.props.muscle}
                    />
                </div>
                <div className="exerciseComponent__item-row">
                    <TextField
                        className="exerciseComponent__item-row-single"
                        id="filled-basic"
                        label="Reps/Time"
                        variant="filled"
                        defaultValue={this.props.repsTime}
                    />
                    <TextField
                        className="exerciseComponent__item-row-single"
                        id="filled-basic"
                        label="Weight"
                        variant="filled"
                        defaultValue={this.props.weight}
                    />
                </div>
            </div>
        );
    }
};

export default ExerciseComponent;
